import React, { Component } from 'react';
const dateformat = require('dateformat');

export default class PriceReport extends Component {
  constructor(props) {
    super(props);
    this.state = {
      orders: null,
      org: null,
      mealsForSale: null,
      uid: null,
      total: null,
    };
  }

  processData() {
    var sortable = [];
    Object.entries(this.props.purchased).forEach(entry => {
      let key = entry[0];
      let value = entry[1];
      sortable.push([value, this.props.purchased[key]['datePurchased']]);
    });

    sortable.sort(function (a, b) {
      return a[1] - b[1];
    });

    var tempArray = [];
    var total = 0;
    for (var i = 0; i < sortable.length && i < 10; i++) {
      tempArray.push(sortable[i][0]);
      total += sortable[i]['cost'];
    }
    this.setState({ total });
    return tempArray;
  }
  async componentDidMount() {
    var orders = this.processData();
    console.log(orders);
    this.setState({ orders });
  }

  renderItems() {
    return (
      this.state.orders.map((order) =>
        <tr>
          <td className="fw-600">Chicken Bacon Ranch Pizza</td>
          <td><span className="badge bgc-green-50 c-green-700 p-10 lh-0 tt-c badge-pill">5 stars</span> </td>
          <td>3:25pm</td>
          <td><span className="text-info">$3.50</span></td>
        </tr>
      )
      );
  }

  render() {
    var date = Date.now();
    var d = dateformat(date, 'dddd, mmmm d, yyyy');
    if (this.state.orders) {
      return (
        <div>
          <div className="sales-report-container">
            <div className="peers ai-c jc-sb gap-40">
              <div className="peer peer-greed">
                <h5>{d}</h5>
                <p className="mB-0">Sales Report</p>
              </div>
              <div className="peer">
                <h3 className="text-right">${total}</h3>
              </div>
            </div>
          </div>
          <div className="table-container">
            <table className="table">
              <thead>
                <tr>
                  <th className=" bdwT-0">Name</th>
                  <th className=" bdwT-0">Feedback</th>
                  <th className=" bdwT-0">Time</th>
                  <th className=" bdwT-0">Price</th>
                </tr>
              </thead>
              <tbody>
                {this.renderItems()}
              </tbody>
            </table>
            <div className="check-container">
              <a href="http://fudlkr.com" className="check-text">Check all the sales</a>
            </div>
          </div>
        </div>
      );
    }
    return <div>Loading...</div>;
  }
}
